@media screen and (max-width: 1024px) {
    selector .entry-info {
        margin-bottom: 10px !important;
    }
}

@media screen and (max-width: 750px) {
selector .aux-portfolio-columns .aux-overlay-content  .entry-main {
    left: -40px !important;
    bottom: 0 !important;
    }
}

@media screen and (max-width: 1650px) {
selector .aux-filters.aux-underline {
    margin-left: 0;
    }
}

/* -- BG Overlay -- */
selector .aux-frame-darken::after {
    background-color: rgba(0, 35, 90, 0.69);
}

/* -- Filters -- */
selector .aux-filters li>a {
    font-weight: 400;
    text-transform: none;
    line-height: 22px;
    color: #536E98;
    margin-right: 25px;
}

selector .aux-filters .aux-selected {
    color: #FFFFFF;
}

selector .aux-filters li>a:hover {
    color: #FFFFFF;
}

selector .aux-filters span {
    position: relative;
}

selector .aux-filters .aux-selected span::after {
    opacity: 1;
}

selector .aux-filters li span::after {
    width: 10px;
    height: 10px;
    background: #FF5E14;
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    left: -20px;
    z-index: 1;
    display: block;
    opacity: 0;
    margin: 0;
}

selector .aux-filters li:first-of-type span::after {
    display: none;
}

/* -- Content -- */
selector .aux-portfolio-columns .aux-overlay-content .entry-header {
    flex: 0 0 100%;
    text-align: left;
}

selector .entry-info {
    text-align: left;
    margin-bottom: -10px;
}

selector .entry-main {
    display: flex;
    flex-wrap: wrap;
    flex-flow: column-reverse;
    padding-left: 40px;
    padding-bottom: 25px;
}

selector .aux-portfolio-columns .aux-overlay-content .entry-main {
    margin-bottom: 0;
    position: absolute;
    left: 25px;
    right: 25px;
    bottom: 25px;
}

/* -- Button -- */
selector .aux-hover-circle-link {
    float: right;
}

selector .aux-portfolio-columns .aux-overlay-content {
    top: auto;
    bottom: 0;
    transform: none;
    padding: 64px 64px;
    height: 100%;
}

selector .aux-arrow-nav.aux-round.aux-semi-small {
    width: 43px;
    height: 43px;
    border-radius: 0;
    background-color: #FF5E14;
}

selector .aux-arrow-nav.aux-outline.aux-white {
    border-color: #FF5E14;
    box-shadow: 0 0 0 1px #FF5E14 inset;
}

selector .aux-arrow-nav.aux-outline.aux-white .aux-overlay::after {
    background-color: #FF5E14;
}

selector .aux-hover-circle-plus {
    display: none;
}

selector .hentry .aux-portfolio-columns .aux-overlay-content, .aux-widget-recent-portfolios .aux-portfolio-columns .aux-overlay-content {
    overflow: visible;
}

selector .aux-svg-arrow.aux-small-right, .aux-svg-symbol.aux-small-right {
    background-position: -175px -427px;
    width: 27px;
    height: 27px;
}

selector .aux-svg-arrow.aux-small-right.aux-white, .aux-svg-symbol.aux-small-right.aux-white {
    background-position: -185px -761px;
}

selector .aux-svg-arrow.aux-small-left, .aux-svg-symbol.aux-small-left {
    background-position: -170px -370px;
    width: 27px;
    height: 27px;
}

selector .aux-svg-arrow.aux-small-left.aux-white, .aux-svg-symbol.aux-small-left.aux-white {
    background-position: -257px -786px;
}

selector .aux-black {
    background-position: 0px 0px;
}

selector .aux-arrow-nav.aux-hover-slide:hover .aux-svg-arrow {
    left: 30.5%;
}

selector .aux-arrow-nav .aux-svg-arrow {
    transition: none;
}


@media only screen and (max-width: 600px) {
    selector .aux-filters li>a {
    margin-right: 0;
    }
